import Skills from './components/Skills';
import Projects from './components/Projects';

function App() {
  return (
    //<div className="App">
     <div>
      <Navbar />
      <Home />
      <About />
      <Skills />
      <Projects />
      <Contact /> 
    </div>
  );
}

export default App;
